import SIgn_img from './SIgn_img'
//import { useNavigate } from 'react-router-dom'
//import { ToastContainer, toast } from 'react-toastify';
//import 'react-toastify/dist/ReactToastify.css';
//import { useLayoutEffect } from 'react'
import '../screens/App.css'
import '../screens/New_sign.css'

import { useState, useEffect } from 'react';
import alanBtn from '@alan-ai/alan-sdk-web';


function New_sign() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('')
  //const [address, setAddress] = useState('');
  const ALAN_Key = '51006685f74dba7c95292ed5ff8657242e956eca572e1d8b807a3e2338fdd0dc/stage'
  useEffect(() => {
    alanBtn({
        key: ALAN_Key,
        onCommand: (commandData) => {
          if(commandData.command === 'email'){
            setEmail(commandData.data)
          }
          if(commandData.command === 'password'){
            setPassword(commandData.data)
          }
          //if(commandData.command === 'address'){
          //  setAddress(commandData.data)
          //}
        }
    });
  });
  return (
    <div className='form-fields'>
      <input
        placeholder='Email'
        name='email'
        onChange={(event) => setEmail(event.target.value)}
        value={email}
        type='text'
      />
      <input
        placeholder='Password'
        name='password'
        onChange={(event) => setPassword(event.target.value)}
        value={password}
        type='text'
      />


      <button className='submit-btn'>Submit</button>
    </div>
  );
}

export default New_sign;
